  false,\n\t\"url\": null,\n\t\"notes\": \"This project captured and banded twenty
  Aleutian Canada geese on Chagulak Island to help determine their wintering grounds
  and capture two additional birds for research needs (mitochondrial DNA sequencing).
  Capture methods similar to those used on Buldir were employed at Chagulak Island
  on 12 and 13 August 1984 on the west and north sides respectively. A total of 22
  Aleutian Canada geese were captured on Chagulak. Of this total, 12 birds were captured
  on the first day on the west side and the remaining 10 the next day on the north
  side. Twenty geese were banded (4 adults, 16 goslings) using metal FWS and green
  plastic leg bands. Due to the importance of this nesting population of the endangered
  Aleutian Canada goose in the eastern Aleutian Islands and hazardous work conditions,
  no additional attempts to study the geese at Chagulak Island are recommended unless
  absolutely necessary.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
